import React from 'react';
import './Login.css';
import './Inse.css';

function Login() {

  ( document ).ready(function() {

    var now = new Date();

    var day = ("0" + now.getDate()).slice(-2);
    var month = ("0" + (now.getMonth() + 1)).slice(-2);

    var today = now.getFullYear()+"-"+(month)+"-"+(day) ;
    ("#fecha").val(today);
});
  return (
    <div>
        <header id='Header'>
              <div></div>
              <div id='log'>
                    <img src='/img/usuario50.jpg' alt=''/>LOGIN
              </div>
              <div id='fecha' >
                    <input id="fechas" type="date" value="2022-01-28"></input>
              </div>
        </header>
        <body>

        <div id="divbienvenido">
           <p class="text-center" id='te1'>Bienvenido</p>
           <p class="text-center" id='te2'>Fundación Mía</p>
           <p class="text-center" id='te3'>Construyendo Futuro</p>        
           <div id='imagen'> <img  src='/img/usuario50.jpg' alt=''/> </div>
        </div>

        <br />
         <form id="formulario">
            <div class="form-group">
                <label for="exampleInputEmail1">Usuario</label>
                <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Ingrese su Usuario" />
            </div>
            <br></br>
            <div class="form-group">
                <label for="exampleInputPassword1">Contraseña</label>
                <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Contraseña" />
            </div>
            <br />
            <div>
                <button id='boton' className='btn btn-danger'>Ingresar</button>
                <br />
                 <br />
                <a id="link" href='./Inse'>He olvidado mi contraseña</a>          
            </div>
         </form>
        </body>
    </div>
  );
}
export default Login;
